class Profile extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            className:"profile"
        }
    }
    render() {
        console.log(this.props)
        return (
        <div className="profileContainer">
        <div
                    className={this.state.className}
                    onMouseOver={() => this.setState({ className:"profile-hover"})}
            onMouseLeave={() => this.setState({ className: "profile"})}
        >
            {this.props}
            </div>
            </div>
    )
    }

}

export default Profile
